(122, 1, 'product', '{\"name\":\"Samsung Gear VR Virtual Reality Headset (Digital)\",\"model\":\"Botble\\\\Ecommerce\\\\Models\\\\Product\",\"slug\":\"samsung-gear-vr-virtual-reality-headset\",\"slug_id\":\"105\",\"is_slug_editable\":\"1\",\"description\":\"<ul><li>Unrestrained and portable active stereo speaker<\\/li><li>Free from the confines of wires and chords<\\/li><li>20 hours of portable capabilities<\\/li><li>Double-ended Coil Cord with 3.5mm Stereo Plugs Included<\\/li><li>3\\/4\\u2033 Dome Tweeters: 2X and 4\\u2033 Woofer: 1X<\\/li><\\/ul>\",\"content\":\"<p>Short Hooded Coat features a straight body, large pockets with button flaps, ventilation air holes, and a string detail along the hemline. The style is completed with a drawstring hood, featuring Rains\\u2019 signature built-in cap. Made from waterproof, matte PU, this lightweight unisex rain jacket is an ode to nostalgia through its classic silhouette and utilitarian design details.<\\/p><p>- Casual unisex fit<\\/p><p>- 64% polyester, 36% polyurethane<\\/p><p>- Water column pressure: 4000 mm<\\/p><p>- Model is 187cm tall and wearing a size S \\/ M<\\/p><p>- Unisex fit<\\/p><p>- Drawstring hood with built-in cap<\\/p><p>- Front placket with snap buttons<\\/p><p>- Ventilation under armpit<\\/p><p>- Adjustable cuffs<\\/p><p>- Double welted front pockets<\\/p><p>- Adjustable elastic string at hempen<\\/p><p>- Ultrasonically welded seams<\\/p><p>This is a unisex item, please check our clothing &amp; footwear sizing guide for specific Rains jacket sizing information. RAINS comes from the rainy nation of Denmark at the edge of the European continent, close to the ocean and with prevailing westerly winds; all factors that contribute to an average of 121 rain days each year. Arising from these rainy weather conditions comes the attitude that a quick rain shower may be beautiful, as well as moody- but first and foremost requires the right outfit. Rains focus on the whole experience of going outside on rainy days, issuing an invitation to explore even in the most mercurial weather.<\\/p>\",\"images\":[null,\"products\\/17.jpg\",\"products\\/17-1.jpg\",\"products\\/17-2.jpg\",\"products\\/17-3.jpg\"],\"product_type\":\"physical\",\"variation_default_id\":\"45\",\"botble-ecommerce-tables-product-variation-table-17_length\":\"10\",\"attribute_sets\":[\"1\",\"2\"],\"has_product_options\":\"1\",\"related_products\":null,\"cross_sale_products\":{\"4\":{\"id\":\"4\",\"is_variant\":\"0\",\"price\":\"0.00\",\"price_type\":\"fixed\",\"apply_to_all_variations\":\"1\"},\"74\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"75\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"76\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"7\":{\"id\":\"7\",\"is_variant\":\"0\",\"price\":\"0.00\",\"price_type\":\"fixed\",\"apply_to_all_variations\":\"1\"},\"82\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"83\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"12\":{\"id\":\"12\",\"is_variant\":\"0\",\"price\":\"0.00\",\"price_type\":\"fixed\",\"apply_to_all_variations\":\"1\"},\"94\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"95\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"96\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"97\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"98\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"15\":{\"id\":\"15\",\"is_variant\":\"0\",\"price\":\"0.00\",\"price_type\":\"fixed\",\"apply_to_all_variations\":\"1\"},\"104\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"105\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\"},\"106\":{\"id\":\"1\",\"is_variant\":\"1\",\"price\":null,\"price_type\":\"fixed\