(1119, 1, 'en', 'packages/optimize/optimize', 'elide_attributes', 'Elide attributes', '2023-11-15 09:35:38', '2023-11-15 09:35:38'),
(1120, 1, 'en', 'packages/optimize/optimize', 'elide_attributes_description', 'This filter reduces the transfer size of HTML files by removing attributes from tags when the specified value is equal to the default value for that attribute. This can save a modest number of bytes, and may make the document more compressible by canonicalizing the affected tags.', '2023-11-15 09:35:38', '2023-11-15 09:35:38'),
